      disp('   this problem occurred.'), disp(' ')
      disp('   E-mail or FAX this information to us at:')
      disp('       E-mail:  marwan@pik-potsdam.de')
      disp('          Fax:  ++49 +331 288 2640'), disp(' ')
      disp('   Thank you for your assistance.')
    end
  end
  warning('on')
  cd(currentpath)
  if isoctave
      more on
  end
end

