%@
%@  case 'dimfit'
%@  
%@  errcode=5;
%@  m1=length(find(sum(ds)+1));
%@  if m0~=1
%@     set(findobj('Tag','Delay','Parent',gcf),'Enable', 'On');
%@  else
%@     set(findobj('Tag','Delay','Parent',gcf),'Enable', 'Off');
%@  end
%@		
