%@%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%% store
%@
%@  case 'store'
%@  
%@  errcode=9;
%@  X=get(findobj('Tag','CRPData','Parent',findobj('Parent',hCRP,'Tag','CRPPlot')),'UserData');
%@  if isempty(X)
%@     warndlg('The CRP matrix is still empty. Please start the computation before storing.','Empty CRP')
%@     waitforbuttonpress
%@  else
%@     assignin('base','X', double(X))
%@  end
%@          
