%@nargoutchk(0,3)
%@
%@for l=1:size(x,2),
%@    f=find(~isnan(x(:,l)));
%@    a(l)=mean(x(f,l));
%@    b(l)=std(x(f,l));
%@    c(l)=var(x(f,l));
%@    k(l)=1.96*b(l)/sqrt(length(x));
%@end     
%@
%@ 
%@%Ausgabe
%@
%@if nargout==0
%@   T=[ ...
%@   {'Mean:                  ' sprintf('%0.4f ',a)} {''}...
%@   {'Konfidence Intervalle: ' sprintf('%0.4f  ',k)} {''}...
%@   {'Standard Deviation:    ' sprintf('%0.4f  ',b)} {''}...
%@   {'Variance:              ' sprintf('%0.4f ',c)}];
%@   msgbox(T,'First Moments');
%@elseif nargout==1
%@   varargout(1)={a};
%@elseif nargout==2
%@   varargout(1)={a};
%@   varargout(2)={b};
%@elseif nargout==3
%@   varargout(1)={a};
%@   varargout(2)={b};
%@   varargout(3)={c};
%@end
