%@
%@%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%% computation 
%@
%@case 'compute'
%@    warning off
%@    if ~nogui
%@        h_fig=findobj('tag','FNN_Fig');
%@        set(0,'ShowHidden','on')
%@        h_axes=findobj('Tag','fnn_axes','Parent',gcf); h_axes=h_axes(1);
%@        h_stopbutton = findobj('tag','button_apply','Parent',h_fig(1));
%@        h_storebutton = findobj('Tag','button_store');
%@        setptr(gcf,'watch'), 
%@        obj=({'maxM','method','r','s','maxN','button_store','button_print','button_close','text'});
%@        for j=1:length(obj); 
%@            h=findobj('Tag',obj{j},'Parent',h_fig(1)); 
%@            if ~isempty(h), set(h,'Enable','Off'), end
%@        end
%@        set(h_stopbutton(1),'ToolTip','Stops the computation.','String','Stop','Callback','set(0,''ShowHidden'',''on'');h=findobj(''tag'',''button_apply'');set(h(1),''String'',''Stopped'');set(0,''ShowHidden'',''off'')')
%@    end
%@    if nogui~=2; 
%@        hw=waitbar(0,'Estimation progress'); 
%@    end
%@   
%@
%@    FNN = NaN * ones(maxM,1);
%@ 
%@    % sub-sample (if specified)
%@    if maxN >= length(x); 
%@        idx = 1:length(x);
%@    else
%@        idx = randperm(length(x),maxN); %random samples
%@        x = x(idx,:);
%@    end
%@    
%@    R_A = std(x);
%@    
%@    for m = 2:maxM+1, 
%@        if nogui~=2
%@             waitbar((m-1)/(maxM))
%@        end
%@        % check if stop button was pressed
%@        if ~nogui
%@            set(0,'ShowHidden','on')
%@            if strcmpi(get(h_stopbutton(1),'string'),'stopped')
%@                FNN((m:maxM)+1,1) = NaN;
%@                break
%@            end
%@        end
%@        
%@        % distance for m - 1
%@        x1 = embed(x,m-1,t);
%@        switch method
%@           case 1
%@              D2 = squareform(pdist(x1,'chebychev').^2); % maximum norm
%@           case 2
%@              D2 = squareform(pdist(x1,'squaredeuclidean')); % euclidean norm
%@           case 3
%@              D2 = squareform(pdist(x1,'cityblock').^2); % minimum norm
%@        end
%@        D2(end-t+1:end,:) = []; % remove last part due to embedding
%@        D2(:,end-t+1:end) = []; % remove last part due to embedding
%@
%@
%@        % nearest neigbours
%@        D2 = D2 + eye(size(D2)) * 1e16; % fill diagonal with big numbers to avoid self-comparison
%@        [minD nn] = min(D2); minD = minD';
%@        
%@        % create phase space vector
%@        x2 = embed(x,m,t);
%@        switch method
%@           case 1
%@              Dm2 = max(abs(x2 - x2(nn,:)),[],2).^2; % distances with nearest neighbours in higher dimension
%@           case 2
%@              Dm2 = sum((x2 - x2(nn,:)).^2,2); % distances with nearest neighbours in higher dimension
%@           case 3
%@              Dm2 = sum(x2 - x2(nn,:),2).^2; % distances with nearest neighbours in higher dimension
%@        end
%@        increase = (Dm2 - minD);
%@        ratio = increase ./ minD;
%@        condition4 = sqrt(ratio) > r; % Kennel, Eq. (4)
%@        condition5 = sqrt(increase) / R_A > s; % Kennel, Eq. (5)
%@        FNN(m-1,1) = sum(condition4 | condition5) / numel(ratio);
%@        
%@     
%@        
%@        if ~nogui, 
%@            %fnn('plot_fnn')
%@            plot(h_axes,1:length(FNN),FNN)
%@            xlabel(h_axes,'Dimension'), ylabel(h_axes,'False Nearest Neighbours')
%@            set(h_axes,'Tag','fnn_axes','layer','top','xlim',[1 maxM],'ylim',[0 1],'xtick',[1:1:maxM],'xgrid','on','ygrid','on')
%@            drawnow
%@        end
%@    
%@    end
%@
%@    if nogui~=2 & ishandle(hw), delete(hw); end
%@    if ~nogui, 
%@        set(0,'ShowHidden','on')
%@        h=findobj('tag','button_apply');
%@        set(h(1),'ToolTip','Starts the computation.','String','Apply','Callback','fnn compute')
%@        for j=1:length(obj); 
%@            h=findobj('Tag',obj{j},'Parent',h_fig(1)); 
%@            if ~isempty(h), set(h,'Enable','On'), end
%@        end
%@	    setptr(h_fig(1),'arrow')
%@        if ~isempty(findobj('Tag','FNN_Fig'))
%@                out_str=FNN;
%@                set(h_storebutton(1),...
%@                      'UserData',out_str)
%@            h=findobj('Tag','button_store');
%@            set(h(1),'Enable','On')
%@        end
%@
%@        if ~nogui, setptr(h_fig(1),'arrow'), end
%@        warning on
%@        try, set(0,props.root), end
%@        if nargout==0
%@            fnn('plot_fnn')
%@        end
%@    end
%@    if nogui
%@       out=FNN;
%@    end
%@   
%@%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%% output
%@
%@case 'plot_fnn'
%@    set(0,'ShowHidden','on')
%@    h_fig=findobj('tag','FNN_Fig');
%@    if ~isempty(h_fig)
%@        h=findobj('Tag','button_store','Parent',h_fig(1));
%@        if isempty(h), return, end
%@        FNN=get(h(1),'UserData');
%@
%@        h_axes=findobj('Tag','fnn_axes','Parent',h_fig(1)); h_axes=h_axes(1);
%@        h_res=findobj('Tag','fnn_result','Parent',h_fig(1)); delete(h_res); 
%@        set(0,'current',h_fig(1))
%@ 
%@        set(h_axes,'Visible','on');
%@        plot(1:length(FNN),FNN), grid on
%@        xlabel('Dimension'), ylabel('False Nearest Neighbours')
%@        set(gca,'Tag','fnn_axes','layer','top','xlim',[1 maxM],'ylim',[0 1],'xtick',[1:1:maxM])
%@        drawnow
%@    end
%@    try, set(0,props.root), end
%@
%@%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%% the end 
%@
%@case 'end'
%@
%@end
%@set(0,'ShowHidden','off')
%@try set(0,props.root), end
%@
%@
%@
