%@
%@      set(findobj('Tag','Status','Parent',findobj('Parent',hCRP,'Tag','CRPPlot')),'String','Reshape Embedding Vectors (2)'),drawnow
%@      px = permute(y2, [ 1 3 2 ]);
%@      py = permute(y2, [ 3 1 2 ]);
