%@      if method>3, method=3; end
%@   else
%@      method=2;
%@   end
%@   x=double(varargin{i_double(1)});
%@   if length(i_double)>1 & max(size(varargin{i_double(2)}))==1
%@     m=varargin{i_double(2)};
