%@        xEmb(:,i) = x(((i-1)*t+1):(end-t*(m-i)));
%@    end
%@else
%@    xEmb = x;
%@    Nx = N;
%@end
%@    
%@%% Find recurrence points (= neighbours) for each state
%@% this is a list of neighbours for each time point/state
