%@    end
%@    borderlines = sort(borderlines,'ascend');
%@    % add longest borderlines to lines
%@    lines = horzcat(lines,borderlines(2:3));
%@end
%@
%@% remove lines of length zero (=no line)
%@zero_lines = lines(:)==0;
%@lines(zero_lines) = []; 
%@
%@b_out= sort(lines,'descend')';
%@a_out = mean(b_out);
%@end
