%@    
%@    if strcmp(type,'normal')
%@        for n=1:numel(starts)
%@            if ends(n) - starts(n) + 1 < border_line_length
%@                lines(n) = ends(n) - starts(n) +1;
%@            elseif ends(n) - starts(n) + 1 == border_line_length
%@                borderline = ends(n) - starts(n) +1;
%@            end
%@        end
%@    elseif strcmp(type,'semi')
%@        for n=1:numel(starts)
